import React, { useState } from "react";

import DeleteUserModal from "./DeleteUserModal";

function Example() {
    const [isModalOpen, setIsModalOpen] = useState(false);

    return (
        <div className="p-4">
            <button
                type="button"
                className="px-4 py-2 text-white bg-red-500 rounded-md hover:bg-red-600 focus:outline-none focus-visible:ring-2 focus-visible:ring-offset-2 focus-visible:ring-red-500"
                onClick={() => setIsModalOpen(true)}
            >
                Open Modal
            </button>
            <DeleteUserModal isOpen={isModalOpen} onClose={() => setIsModalOpen(false)} />
        </div>
    );
}

export default Example;
